let sid=getUrlParam("sid");$.getJSON("/api/submit/info/"+sid,function(a){if(a.state==0){narn("log","获取评测信息失败")}if(a.state==1){$("div.panel-heading").text("编译信息");$("div.panel-body").html(a.msg)}else{if(a.state==2){$("div.panel-heading").text("系统错误");$("div.panel-body").text("可能是系统遇到了故障，请稍后重试或联系管理员")}else{if(a.state==3){$("div.panel-heading").text("错误信息");$("div.panel-body p").text("在第"+a.pos+"组数据处发送错误");$("div.panel-body table tbody").append(HTML.trNum(3,Array(HTML.td(a.input),HTML.td(a.output),HTML.td("此功能暂未实现，请下载数据自行测试"))))}}}});